// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/UUPSUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/AccessControlUpgradeable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract TokenVaultV1 is Initializable, AccessControlUpgradeable, UUPSUpgradeable {    
    bytes32 public constant UPGRADER_ROLE = keccak256("UPGRADER_ROLE");

    // 2. State Variables: These will live in the Proxy's storage
    address public assetToken;
    uint256 public depositFee; // This is in BPS (e.g., 500 = 5%)
    uint256 private _totalDeposits;
    mapping(address => uint256) private _balances;

    /// @custom:oz-upgrades-unsafe-allow constructor
    constructor() {
        _disableInitializers(); // Prevents anyone from messing with the "Brain" directly
    }

    function initialize(address _token, address _admin, uint256 _fee) public initializer {
        __AccessControl_init();
        __UUPSUpgradeable_init();

        assetToken = _token;
        depositFee = _fee;

        // Grant the Admin and Upgrader roles to the person who deployed it
        _grantRole(DEFAULT_ADMIN_ROLE, _admin);
        _grantRole(UPGRADER_ROLE, _admin);
    }

    // --- YOUR TASK: COMPLETE THE FUNCTIONS BELOW ---

    function deposit(uint256 amount) external {
        // 1. Calculate the fee: (amount * depositFee) / 10000
        uint256 fee = (amount * depositFee) / 10000;

        // 2. Calculate netAmount: amount - fee
        uint256 netAmount = amount - fee;

        // 3. Use IERC20(assetToken).transferFrom to pull 'amount' from msg.sender to this address
        IERC20(assetToken).transferFrom(msg.sender, address(this), amount);

        // 4. Update the storage: 
        //    - Add netAmount to _balances[msg.sender]
        //    - Add netAmount to _totalDeposits
        _balances[msg.sender] += netAmount;
        _totalDeposits += netAmount;
    }

    function withdraw(uint256 amount) external {
        // 1. Require that _balances[msg.sender] is >= amount
        require(_balances[msg.sender] >= amount, "Insufficient balance");

        // 2. Subtract amount from _balances[msg.sender]
        _balances[msg.sender] -= amount;

        // 3. Subtract amount from _totalDeposits
        _totalDeposits -= amount;

        // 4. Use IERC20(assetToken).transfer to send 'amount' back to msg.sender
        IERC20(assetToken).transfer(msg.sender, amount);
    }

    // --- HELPER FUNCTIONS ---

    function balanceOf(address user) external view returns (uint256) {
        return _balances[user];
    }

    function totalDeposits() external view returns (uint256) {
        return _totalDeposits;
    }

    function getDepositFee() external view returns (uint256) {
        return depositFee;
    }

    function getImplementationVersion() external pure returns (string memory) {
        return "V1";
    }

    // Required by UUPS to restrict who can upgrade
    function _authorizeUpgrade(address newImplementation) internal override onlyRole(UPGRADER_ROLE) {}

    // 5. THE GAP: This reserves 50 slots of space for future versions (V2, V3)
    uint256[50] private __gap;
}

